= $derived.by(() => {
        const gymSessions = sessions.filter(s => s.activityType === 'gym_session') as any[];
        const names = new Set<string>();
        gymSessions.forEach(s => {
            if (s.exercises) {
                s.exercises.forEach((e: any) => names.add(e.name));
            }
        });
        return Array.from(names).sort();
    })
